import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import { Card } from './Components/Card/Card';
import { Header } from './Components/Header/Header';
import { HomePage } from './Components/Pages/HomePage/HomePage';
import { AboutPage } from './Components/Pages/AboutPage/AboutPage';

function App() {
  const data = [
    {
      name: 'Arcade Alien',
      status: 'Unknown',
      price: 1000,
      img: 'https://www.google.com/url?sa=i&url=https%3A%2F%2Fmetarankings.ru%2Freviews%2Frik-i-morti%2F&psig=AOvVaw0mQMUwzXkcCrzVI8MWuMPu&ust=1664950609236000&source=images&cd=vfe&ved=0CAwQjRxqFwoTCIjfqb_2xfoCFQAAAAAdAAAAABAN',
    },
    {
      name: 'Aaaaaa',
      price: 0,
      img: 'https://rick-i-morty.online/wp-content/uploads/2022/08/6-season-185x278.jpg',
    },
    {
      name: 'fsdfa',
      price: 1000,
      img: 'https://www.google.com/url?sa=i&url=https%3A%2F%2Feksmo.ru%2Ftrends%2F10-nauchnykh-teoriy-i-zakonov-iz-rika-i-morti-ID15525423%2F&psig=AOvVaw0mQMUwzXkcCrzVI8MWuMPu&ust=1664950609236000&source=images&cd=vfe&ved=0CAwQjRxqFwoTCIjfqb_2xfoCFQAAAAAdAAAAABAX',
    },
  ]

  return (
    <BrowserRouter>
      <div className="App">
        <Header phone={'89270000000'} />
        <div className='container'>
          <Routes>
            <Route path='/' element={<HomePage data={data}/>} />
            <Route path='/about' element={<AboutPage/>} />
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
